import sys

N, M = map(int, input().split())

tree = [[] for _ in range(N)]
for _ in range(M):
    a, b = map(int, input().split())
    tree[a-1].append(b-1)
    tree[b-1].append(a-1)

def dfs(v, visited):
    visited.add(v)
    for child in tree[v]:
        if child not in visited:
            dfs(child, visited)

